Este soneto satírico es obra del poeta español Luis de Góngora (1561-1627), representante del culteranismo barroco. El poema hace referencia al mito clásico de Leda y el cisne, donde Zeus (Júpiter) se transforma en cisne para seducir a Leda, esposa de Tíndaro.
